import Types from './Types.js';
import Targets from './Targets.js';


function WorkoutGenerator() {

  let one = "one";
  let two = "two";
  let three = "three";

  function refreshPage() {
    // window.location.reload(false);
    let test = document.getElementById("number").value;
    console.log(test);

  }


  return (
    <div className="workout-generator">
      <h2>Generate Workout</h2>
      <form autoComplete="off" target="formframe" onSubmit={ () => refreshPage() }>
          <input type="text" id="type" name="type" placeholder="Type" list="typelist" required />
          <Types />
          <input type="text" id="target" name="target" placeholder="Target" list="targetlist" required />
          <Targets />
          <input type="number" id="reps" name="reps" placeholder="Reps" required />
          <input type="submit" placeholder="Submit" />
        </form> 
        <div>
          <h5>Type: { one } </h5>
          <h5>Target:  { two } </h5>
          <h5>Reps:  { three } </h5>
        </div>
    </div>
  );
}

export default WorkoutGenerator;
